import React from 'react'

const Part = (props) => {
    console.log(props.part)
    let result = Object.keys(props).map((key) =>
        <p>{key} {props[key]}</p>
    );
    return (
        <div>
            <p>{result}</p>
        </div>
    )
};

export default Part;
